import { Modal, Button } from "antd";

class Index extends Component {
  state = { visible: false };

  render() {
    return (
      <div>
        <div
          style={{
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-around",
            alignItems: "center",
            height: "100vh"
          }}
        >
          <div>
            <div
              style={{
                fontWeight: "bold",
                fontSize: "4vw",
                fontFamily: "BlinkMacSystemFont"
              }}
            >
              {" "}
              SleepCoin{" "}
            </div>
            <hr />
            <div style={{ fontSize: "2vw", fontFamily: "BlinkMacSystemFont" }}>
              {" "}
              Rest and invest
            </div>

            <Button
              style={{ fontSize: "1vw", textAlign: "center" }}
              type="link"
            >
              Partnerships
            </Button>
          </div>

          <div style={{ display: "flex", alignItems: "center" }}>
            <img
              src="https://sleepcoin.s3-us-west-1.amazonaws.com/Screen+Shot+2020-02-15+at+11.16.03+PM.png"
              style={{ width: "25vw" }}
            />
          </div>
        </div>

        <Modal
          title="Basic Modal"
          visible={this.state.visible}
          onCancel={() => {
            this.setState({ visible: false });
          }}
        >
          <p>Some contents...</p>
          <p>Some contents...</p>
          <p>Some contents...</p>
        </Modal>
      </div>
    );
  }
}

export default Index;
